import React from 'react';
import './Home.scss';


function ShowHeader() {
  const menulist = [
    {name:"Home",id:"#"},
    {},
    {name:"Shop",id:"#shop"},
    {},
    {name:"Cart",id:"#cart"},
    {},
    {name:"Log in",id:"#login"},
  ];
  return (
    <div className="header_content">
      {menulist.map(item => (
        <span className="smallfont-bigger">
          <a className="header_content_items" href={item.id}>{item.name}</a>
        </span>
      ))}
    </div>
  );
}

function Home() {
  return (
    <div className="home_parent" id="home">

      <div className="header">
        <ShowHeader />
      </div>

      <div className="home">
        <div className="home_content">
          <div>
            <span className="largefont" style={{color:"#509650"}}>Notebooks<br/>& Co.</span><br/>
            <span className="smallfont"><br/>Notebooks & Co. is an online school-supply<br/>
            retailer where fantastic products<br/>
            meet fantastic students</span>
          </div>
        </div>

      </div>


    </div>
  )
}

export default Home;


